import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className='app_wrapper'>
      <header className ='header'>
        <div className='header__logo'>
          <img src="https://w7.pngwing.com/pngs/803/598/png-transparent-phoenix-logo-phoenix-red-bird-illustration-leaf-photography-mirror.png" />
        </div>
      </header>
      <nav className='nav'>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
        <div>Settings</div>
      </nav>
      <div className='content'>
        <img src='https://yenisey.co/photos/5/LRM_EXPORT_332003029365118_20190816_120348535.jpeg' />
      </div>
    </div>
  );
}

export default App;
